import React from 'react'
import { Container, Row ,Col,Button } from 'react-bootstrap'
import headerimg from './assets/insta.png';
import {useState,useEffect} from 'react';
import {ArrowDown} from 'react-bootstrap-icons';

export const Home = () => {
    return (
        <section className='home text-light align-items-center' id='home'>
            <Container>
             <Row className='align-items-center'>
             <Col xs={12} md={6} xl={7}>
                <span className='tag-line'><h1 style={{fontSize:50}}>Welcome to my Portfolio</h1></span>
                <h1>{`Hi I'm webdecoded`}<span className='wrap'>web developer</span></h1>
                <p>find a paragraph to write here</p>
                <Button variant='link' onClick={()=> console.log('connect')}>Let's connect<ArrowDown size={25}/></Button>
             </Col>
             </Row>
            </Container>
        </section>
    )
}
